import React from 'react'
import {Link} from 'react-router-dom';
import {Stack} from '@mui/material';
import Logo from '../assets/assets/images/Logo.png';
const Navbar = () => {
  return (
 <Stack>
    <Link to='/'> 
    <img src ={Logo} alt='Logo' style={{width:'48px', height:'48px', margin: '0 20px',textDecoration:'none' , color:'#3A1212', borderBottom:'3px solid #FF2625' }} />
    </Link>
    <Stack
    direction="row">
        <Link to='/'>Home</Link>
        <a href='#exercises' style={{textDecoration:'none' , color:'#3A1212'}}>
            Exercises
        </a>
    </Stack>
 </Stack>
  )
}

export default Navbar
